import React from 'react';
import './ranking.css';

const Rankings = ({players}) => {
    return (
        <div className="main"> 
            {players.map((player) => (
                <div className="row"> 
                    <div className="col1">
                        {player.id}
                    </div>
                    <br/>
                    <div className="col2">
                        {player.name}
                    </div>
                </div>
            ))}
        </div>
    )
}

export default Rankings
